import React, { useState, useEffect } from "react";
import { Player } from "~/components/midi/Player";
import { MidiParser } from "~/lib/MidiParser";
import { type GetMidiOutput } from "~/server/api/routers/midi";

// MIDI examples are from https://bitmidi.com/
const midiDataExamples = [
  {
    name: "Pirates of the Caribbean - He's a Pirate",
    base64:
      "",
  },
  {
    name: "A'TEENS - Gimme gimme gimme [with subtitles]",
    base64:
      "",
  },
  {
    name: "Never Gonna Give You Up",
    base64:
      "",
  },
];

export default function Base64Midi() {
  const [midiOutput, setMidiOutput] = useState<GetMidiOutput | null>(null);
  const [selectedExample, setSelectedExample] = useState(0);

  useEffect(() => {
    loadMidiFromBase64(selectedExample);
  }, [selectedExample]);

  const loadMidiFromBase64 = (index: number) => {
    try {
      const { name, base64 } = midiDataExamples[index];
      const midiBytes = Uint8Array.from(atob(base64), c => c.charCodeAt(0));
      setMidiOutput(prepareMidiFromBase64(midiBytes, name));
    } catch (error) {
      console.error("Chyba při dekódování MIDI dat:", error);
    }
  };

  return (
    <div>
      <p className="text-gray-400">Ukázkové MIDI pochází z <a className="link-info" href="https://bitmidi.com/" target="_blank">bitmidi.com</a></p>
      {/* label výběr demo skladeb */}
      <label className="text-white font-bold mt-3 block">Vyberte ukázkovou skladbu:</label>

      <select className="rounded-lg border bg-white px-4 py-2 leading-tight text-black focus:outline-none focus:ring dark:bg-gray-700 dark:text-white" value={selectedExample} onChange={e => setSelectedExample(Number(e.target.value))}>
        {" "}
        {midiDataExamples.map(({ name }, index) => (
          <option key={index} value={index}>
            {name}
          </option>
        ))}
      </select>
      {midiOutput ? <Player key={selectedExample} midi={midiOutput} /> : <div>Načítání...</div>}
    </div>
  );
}

function prepareMidiFromBase64(midi: Uint8Array, name: string): GetMidiOutput {
  const parsedMidi = MidiParser.parse(midi);
  const { introText, lyrics } = parsedMidi ?? { introText: [], lyrics: [] };
  const headerText = introText.join("").trim();
  const plainLyrics = lyrics
    .map(v => v.text)
    .join("")
    .trim();
  console.log("Hellooo", parsedMidi);
  return {
    midi: midi,
    description: headerText,
    text: plainLyrics,
    name: name,
    id: 0,
    userId: "base64",
  };
}
